ic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>",null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R","<expr>"]},"interval":10,"files":[{"filename":"<expr>","content":"p <- profvis({\n  set.seed(10)\n  selected_model_inference(dat, fit_method = fit_method, test_func = test_func,\n                           num_samp = num_samp, ignore_jump = 1,\n                           cores = cores, verbose = F, param = list(burn_in = 2000, lapse = 1))\n})\n","normpath":"<expr>"},{"filename":"/R/hitrun_radial.R","content":"#' Hit and run sampler, Radial\n#'\n#' For unknown sigma\n#'\n#' @param y data\n#' @param segments matrix created by \\code{.segments}\n#' @param polyhedra \\code{polyhedra} object\n#' @param num_samp number of desired samples from null distribution\n#' @param cores umber of cores\n#' @param burn_in positive integer of the first few samples to throw out per core\n#' @param lapse positive integer, where we sample \\code{num_samp*burn_in}\n#' samples from the null distribution and return every \\code{burn_in}th sample\n#' @param verbose boolean\n#'\n#' @return matrix with \\code{num_samp} columns and \\code{length(y)} rows\n.sampler_hit_run_radial <- function(y, segments, polyhedra, num_samp = 100,\n                                    burn_in = 500, lapse = 2, verbose = F){\n  num_col <- burn_in + num_samp*lapse\n  y_mat <- matrix(NA, nrow = length(y), ncol = num_samp)\n  seq_idx <- burn_in + (1:num_samp)*lapse\n\n  prev_y <- y\n\n  for(i in 1:num_col){\n    next_y <- .hit_run_next_point_radial(prev_y, segments, polyhedra)\n    if(i %in% seq_idx){\n      y_mat[,which(seq_idx == i)] <- next_y\n    }\n\n    prev_y <- next_y\n  }\n\n  stopifnot(all(.try_polyhedra(y_mat, polyhedra)))\n  y_mat\n}\n\n#' Output the next point for hit-and-run sampler, Radial\n#'\n#' For unknown sigma\n#'\n#' @param y data\n#' @param segments matrix created by \\code{.segments}\n#' @param polyhedra \\code{polyhedra} object\n#'\n#' @return vector\n.hit_run_next_point_radial <- function(y, segments, polyhedra){\n  stopifnot(ncol(segments) == length(y))\n\n  tmp <- .sample_matrix_space(segments, 2, null = T)\n  v <- tmp[,1]; w <- tmp[,2]\n  interval <- .range_theta_polyhedra(y, v, w, polyhedra)\n\n  if(nrow(interval) == 1) {\n    theta <- stats::runif(1, interval[1], interval[2])\n  } else {\n    len <- interval[,2] - interval[,1]\n    row_idx <- sample(1:nrow(interval), 1, prob = len)\n    theta <- stats::runif(1, interval[row_idx,1], interval[row_idx,2])\n  }\n\n  y_new <- .radians_to_data(theta, y, v, w)\n\n  stopifnot(.try_polyhedra(y_new, polyhedra))\n\n  y_new\n}","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/hitrun_radial.R"},{"filename":"/R/selectiveModel.R","content":"#' Selected model inference\n#'\n#' Fits a changepoint model using \\code{fit_method} to \\code{y}. The returned\n#' model needs to have a function defined via the generic function\n#' \\code{binSeg::polyhedra}. Inference is performed by sampling data from the\n#' null distribution matching the estimated changepoint model\n#' where each sample is drawn from a Gaussian and matches\n#' in empirical means in each segment and in L2-norm (the sufficient statistics).\n#'\n#' Currently the test is a 2-sided test.\n#'\n#' The \\code{test_func} should be a function that takes in \\code{y} as the first\n#' input and the output of \\code{fit_method} as the second input, and \\code{...}\n#' as the third input.\n#'\n#' If \\code{sigma} is \\code{NA}, then the function conditions on \\code{.l2norm(y)}.\n#' Otherwise, \\code{sigma} represents the standard deviation of the marginal distribution\n#' of \\code{y}, asserting that each coordinate is independent and Gaussian.\n#'\n#' @param y data of length n\n#' @param fit_method function to fit changepoint model\n#' @param test_func function to apply to each \\code{y} and fitted model\n#' @param num_samp number of desired samples from null distribution\n#' @param sample_method either \\code{hit_run} or \\code{rejection}\n#' @param sigma postive number or \\code{NA}.\n#' @param ignore_jump which jump to ignore\n#' @param param additional parameters for \\code{sample_method} passed in as a list\n#' @param cores number of cores, only for rejection sampling\n#' @param verbose boolean\n#' @param ... optional inputs for \\code{test_func}\n#'\n#' @return quantile\n#' @export\nselected_model_inference <- function(y, fit_method,\n                                     test_func = next_jump_statistic,\n                                     num_samp = 100,\n                                     sample_method = \"hitrun\",\n                                     sigma = NA,\n                                     ignore_jump = NA,\n                                     param = list(burn_in = default_burn_in(),\n                                                  lapse = default_lapse()),\n                                     cores = 1, verbose = T, ...){\n\n  #fit the model, fit polyhedra, and compute test statistic on the observed model\n  n <- length(y)\n  fit <- fit_method(y)\n  polyhedra <- binSegInf::polyhedra(fit)\n  test_stat <- test_func(y, fit, jump = ignore_jump, ...)\n\n  #prepare sampler\n  segments <- .segments(n, binSegInf::jumps(fit), ignore_jump = ignore_jump)\n  param <- .fill_in_arguments(param)\n\n  #pass to sampler\n  if(is.na(sigma)) {\n    if(sample_method == \"hitrun\") {\n      samples <- .sampler_hit_run_radial(y, segments, polyhedra, num_samp = num_samp,\n                                         burn_in = param$burn_in, lapse = param$lapse,\n                                         verbose = verbose)\n    } else if(sample_method == \"rejection\") {\n      samples <- .sampler_rejection_radial(y, segments, polyhedra, num_samp = num_samp,\n                                           cores = cores, verbose = verbose)\n    } else {\n      stop(\"sample_method not appropriate\")\n    }\n  } else {\n    if(sample_method == \"hitrun\") {\n      gaussian <- .gaussian(rep(0, n), sigma^2*diag(n))\n      samples <- .sampler_hit_run_line(y, gaussian, segments, polyhedra, num_samp = num_samp,\n                                       burn_in = param$burn_in)\n    } else {\n      stop(\"sample_method not appropriate\")\n    }\n  }\n\n  #for each sample, run the test function\n  null_stat <- apply(samples, 2, function(x){\n    test_func(x, fit, jump = ignore_jump, ...)\n  })\n\n  #compute the quantile\n  pval <- length(which(abs(null_stat) >= abs(test_stat)))/length(null_stat)\n\n  list(pval = pval, test_stat = test_stat, null_stat = null_stat)\n}\n\n#' Compute the matrix of segments\n#'\n#' Return a matrix \\code{mat} such that\n#' for a data vector \\code{y}, we have\n#' \\code{mat %*% y} would output the empirical means of each segment of \\code{y}\n#' according to \\code{jump_vec}.\n#'\n#' \\code{jump_vec} is a vector of indices (not necessarily in any particular\n#' order) less than or equal to \\code{n}. A value of \\code{i} in \\code{jump_vec}\n#' denotes that there is jump between index \\code{i} and \\code{i+1}.\n#' \\code{jump_vec} does not need to include \\code{n}.\n#'\n#' @param n number of samples\n#' @param jump_vec vector of indices\n#' @param ignore_jump which jump to ignore\n#'\n#' @return s-row matrix, where s is equal to \\code{length(jump_vec+1)}\n.segments <- function(n, jump_vec, ignore_jump = NA){\n  if(all(is.na(jump_vec))) return(matrix(rep(1/n,n), nrow = 1))\n\n  stopifnot(all(jump_vec >= 1), all(jump_vec <= n), all(jump_vec %% 1 == 0))\n  jump_vec <- sort(jump_vec)\n  if(!is.na(ignore_jump)){\n    stopifnot(ignore_jump %% 1 == 0, ignore_jump > 0, ignore_jump <= length(jump_vec))\n    jump_vec <- jump_vec[-ignore_jump]\n  }\n  jump_vec <- unique(sort(c(0,jump_vec, n)))\n\n  len <- length(jump_vec)\n  mat <- sapply(1:(len-1), function(x){\n    vec <- rep(0, n)\n    vec[(jump_vec[x]+1):jump_vec[(x+1)]] <- 1/(jump_vec[x+1]-jump_vec[x])\n    vec\n  })\n\n  t(mat)\n}\n\n#' Computes the empirical mean of each segment\n#'\n#' @param y data\n#' @param segments matrix created by \\code{.segments}\n#'\n#' @return vector\n.segment_means <- function(y, segments){\n  stopifnot(!is.matrix(y), length(y) == ncol(segments))\n  as.numeric(segments %*% y)\n}\n\n.l2norm <- function(vec){\n  as.numeric(sqrt(sum(vec^2)))\n}\n\n.fill_in_arguments <- function(param){\n  burn_in <- ifelse(!is.null(param$burn_in), param$burn_in, default_burn_in())\n  lapse <- ifelse(!is.null(param$lapse), param$lapse, default_lapse())\n\n  list(burn_in = burn_in, lapse = lapse)\n}\n\n#' Default burn in\n#'\n#' @return numeric\n#' @export\ndefault_burn_in <- function(){2000}\n\n#' Default lapse\n#'\n#' @return numeric\n#' @export\ndefault_lapse <- function(){2}","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/selectiveModel.R"},{"filename":"/R/geometry.R","content":"#' Construct a 2-dimensional circle class\n#'\n#' @param center vector of length 2\n#' @param radius numeric\n#'\n#' @return a \\code{circle} object\n.circle <- function(center, radius){\n  structure(list(center = as.numeric(center), radius = as.numeric(radius)), class = \"circle\")\n}\n\n#' Construct a line object\n#'\n#' @param point vector\n#' @param direction vector\n#'\n#' @return a \\code{line} object\n.line <- function(point, direction){\n  stopifnot(length(point) == length(direction))\n\n  direction <- direction/.l2norm(direction)\n  structure(list(point = point, direction = direction), class = \"line\")\n}\n\n#' Construct a hyperplane\n#'\n#' Hyperplane is of form \\code{a%*%x = b}.\n#' If \\code{a} is a matrix, this object represents an intersection of hyperplanes.\n#'\n#' @param a matrix\n#' @param b vector\n#'\n#' @return a \\code{plane} object\n.plane <- function(a, b = 0){\n  if(!is.matrix(a)){a <- matrix(a, nrow = 1)}\n  stopifnot(length(b) == nrow(a))\n  stopifnot(length(which(a != 0)) > 0)\n\n  l2_vec <- apply(a, 1, .l2norm)\n  b <- as.numeric(b/l2_vec)\n  if(length(l2_vec) > 1){\n    a <- diag(1/l2_vec)%*%a\n  } else {\n    a <- a/l2_vec\n  }\n\n  structure(list(a = a, b = b), class = \"plane\")\n}\n\n#' Convert a higher-dimensional plane into the two-dimensional coordinate system\n#'\n#' If the coordinate system set up by \\code{v} and \\code{w} is parallel to \\code{plane},\n#' an \\code{NA} is returned.\n#'\n#' @param plane \\code{plane} object\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#' @param tol small positive number\n#'\n#' @return either a \\code{plane} object or \\code{NA}\n.intersect_plane_basis <- function(plane, y, v, w, tol = 1e-6){\n  a <- plane$a%*%cbind(v, w)\n  if(length(which(abs(a) > tol)) > 0){\n    .plane(a, plane$b - plane$a%*%y)\n  } else{\n    NA\n  }\n}\n\n#' Returns a point on the plane\n#'\n#' If \\code{plane} is only one plane, this function uses a deterministic\n#' method to find a point that lines along a hyperplane.\n#'\n#' If \\code{plane} is an intersection of many hyperplanes, this function\n#' uses a linear program to find a point on the plane. The linear program\n#' is minimize sum t_1,...t_n such that Ay = b, t_i >= y_i, t_i >= -y_i for all\n#' i in 1 to n.\n#'\n#' @param plane \\code{plane} object\n#'\n#' @return a vector\n.point_on_plane <- function(plane){\n  if(nrow(plane$a) == 1){\n    d <- length(plane$a)\n    vec <- rep(0, d)\n    idx <- which(plane$a != 0)\n    stopifnot(length(idx) >= 1)\n    idx <- idx[1]\n    vec[-idx] <- 1\n    vec[idx] <- as.numeric(plane$b - plane$a[-idx]%*%vec[-idx])/plane$a[idx]\n\n    vec\n  } else {\n    k <- nrow(plane$a); n <- ncol(plane$a)\n    mat <- matrix(0, ncol = 3*n, nrow = k+2*n)\n\n    mat[1:k,1:n] <- plane$a\n    mat[1:k,(n+1):(2*n)] <- -plane$a\n\n    diag(mat[(k+1):nrow(mat),(2*n+1):(3*n)]) <- 1\n    diag(mat[(k+1):(k+n),1:n]) <- -1\n\n    diag(mat[(k+1+n):nrow(mat),(2*n+1):(3*n)]) <- 1\n    diag(mat[(k+1+n):nrow(mat),(n+1):(2*n)]) <- -1\n\n    vec <- c(plane$b, rep(0, 2*n))\n    res <- lpSolve::lp(objective.in = c(rep(0, 2*n), rep(1, n)), const.mat = mat,\n                       const.dir = c(rep(\"=\", k), rep(\">=\", 2*n)),\n                       const.rhs = vec)\n\n    if(res$status == 2) {\n      stop(\"LP to find point on plane failed\")\n    }\n    res$solution[1:n] - res$solution[(n+1):(2*n)]\n  }\n}\n\n#' Compute euclidean distance from point to plane\n#'\n#' @param point vector\n#' @param plane \\code{plane} object\n#'\n#' @return numeric\n#' @source \\url{https://en.wikipedia.org/wiki/Distance_from_a_point_to_a_plane}\n.distance_point_to_plane <- function(point, plane){\n  stopifnot(length(point) == length(plane$a))\n  stopifnot(nrow(plane$a) == 1)\n\n  x <- .point_on_plane(plane)\n  .l2norm(plane$a%*%(point - x))/.l2norm(plane$a)\n}\n\n#' Intersect circle with plane\n#'\n#' The \\code{plane} object must be in 2-dimensions\n#'\n#' The output is a 2x2 matrix, where the first column represents the first\n#' point and the second column represents the second point.\n#'\n#' If there is only one point, then the output is a 2x1 matrix.\n#' If no points are found, return \\code{NA}.\n#'\n#' \\code{tol} is used to differentiate zero from non-zero. \\code{tol2} is used\n#' to determine if there are one or two roots.\n#'\n#' @param plane \\code{plane} object\n#' @param circle \\code{circle} object\n#' @param tol small positive number\n#' @param tol2 small positive number\n#'\n#' @return matrix of size 2x2 or \\code{NA}\n.intersect_circle_line <- function(plane, circle, tol = 1e-6, tol2 = 1e-9){\n  stopifnot(length(plane$a) == 2, length(which(plane$a != 0)) > 0)\n  stopifnot(nrow(plane$a) == 1)\n\n  dis <- .distance_point_to_plane(circle$center, plane)\n  if(dis > circle$radius + tol) return(NA)\n\n  if(abs(plane$a[2]) < tol){\n    #treat plane$a[2] as zero\n    x <- plane$b/plane$a[1]\n    y <- circle$center[2] + c(-1, 1) * sqrt(circle$radius^2 - (x - circle$center[1])^2)\n\n  } else if(abs(plane$a[1]) < tol) {\n    #treat plane$a[1] as zero\n    y <- plane$b/plane$a[2]\n    x <- circle$center[1] + c(-1, 1) * sqrt(circle$radius^2 - (y - circle$center[2])^2)\n\n  } else {\n    a1 <- plane$a[1]; a2 <- plane$a[2]\n    c1 <- circle$center[1]; c2 <- circle$center[2]\n\n    a <- 1 + (a1/a2)^2\n    b <- -2*(a1/a2)*(plane$b/a2 - c2) -2*c1\n    c <- -circle$radius^2 + (plane$b/a2 - c2)^2 + c1^2\n\n    x <- .quadratic(a, b, c)\n    stopifnot(all(!is.na(x)))\n    y <- (plane$b - a1*x)/a2\n  }\n\n  if((length(x) == 1 || abs(x[1]-x[2]) < tol2) && (length(y) == 1 || abs(y[1]-y[2]) < tol2)){\n    mat <- matrix(c(x[1], y[1]), nrow = 2)\n  } else {\n    mat <- rbind(x, y)\n  }\n  colnames(mat) <- NULL\n\n  mat\n}\n\n#' Determine a point on plane closest to origin\n#'\n#' @param plane \\code{plane} object\n#'\n#' @return vector\n#' @source \\url{https://math.stackexchange.com/questions/832279/closest-point-to-a-vector-in-a-subspace}\n.closest_point_to_origin <- function(plane){\n  rowspace <- .sample_matrix_space(plane$a, null = F)\n  point <- .point_on_plane(plane)\n\n  #project against each vector\n  mat <- sapply(1:ncol(rowspace), function(x){\n    rowspace[,x]%*%t(rowspace[,x])%*%point\n  })\n\n  rowSums(mat)\n}\n\n#' Sample from a n-1 dimensional unit sphere uniformally\n#'\n#' @param n positive integer larger than 1\n#'\n#' @return vector of length n\n.sample_sphere <- function(n){\n  vec <- stats::rnorm(n)\n  vec/.l2norm(vec)\n}\n\n#' Quadratic formula\n#'\n#' The function returns a vector of length two if there are two roots,\n#' the first smaller than the second. If there is only one root, then only\n#' one numeric is returned. If no roots are found, then \\code{NA} is returned.\n#'\n#' @param a numeric\n#' @param b numeric\n#' @param c numeric\n#' @param tol small positive number\n#'\n#' @return vector of length 2\n.quadratic <- function(a, b, c, tol = 1e-8){\n  stopifnot(is.numeric(a), is.numeric(b), is.numeric(c))\n  stopifnot(length(c(a,b,c)) == 3)\n\n term <- b^2 - 4*a*c\n if(term < 0) return(NA)\n if(abs(term) < tol) return(-b/(2*a))\n\n sort(c((-b-sqrt(term))/(2*a), (-b+sqrt(term))/(2*a)))\n}\n\n#' Intersect a polyhedron with a line\n#'\n#' Computes one endpoint by solving the following optimization problem:\n#' max a s.t. polyhedra$gamma * (point + a*direction) >= polyhedra$u.\n#' Since the linear program forces all variables to be non-negative, additional\n#' transformations are needed. The other endpoint is solved by a minimization problem.\n#'\n#' This function assumes that \\code{line$point} is a valid point inside the\n#' polyhedra.\n#'\n#' @param polyhedra a \\code{polyhedra} object\n#' @param line a \\code{line} object\n#'\n#' @return a vector of length 2\n.intersect_polyhedron_line <- function(polyhedra, line){\n  stopifnot(ncol(polyhedra$gamma) == length(line$direction))\n  stopifnot(all(polyhedra$gamma %*% line$point >= polyhedra$u))\n  d <- length(polyhedra$u)\n\n  vec <- polyhedra$gamma %*% line$direction\n  rhs_vec <- polyhedra$u - polyhedra$gamma %*% line$point\n  constr_mat <- cbind(vec, -vec)\n\n  res1 <- lpSolve::lp(direction = \"min\",\n                      objective.in = c(1, -1), const.mat = constr_mat,\n                      const.dir = rep(\">=\", d), const.rhs = rhs_vec)\n\n  res2 <- lpSolve::lp(direction = \"max\",\n                      objective.in = c(1, -1), const.mat = constr_mat,\n                      const.dir = rep(\">=\", d), const.rhs = rhs_vec)\n\n  val1 <- ifelse(res1$status == 0, res1$solution[1] - res1$solution[2],\n                 -Inf)\n  val2 <- ifelse(res2$status == 0, res2$solution[1] - res2$solution[2],\n                 Inf)\n\n  stopifnot(0 >= val1, 0 <= val2)\n\n  c(val1, val2)\n}","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/geometry.R"},{"filename":"/R/radians.R","content":"#' Find the range of theta's that are in the polyhedra\n#'\n#' Finds theta's such that for each theta,\n#' \\code{.radians_to_data(theta, y, v, w)} is inside the polyhedra.\n#'\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#' @param polyhedra \\code{polyhedra} object\n#'\n#' @return vector of possible theta's\n.range_theta_polyhedra <- function(y, v, w, polyhedra){\n  stopifnot(.try_polyhedra(y, polyhedra))\n  stopifnot(abs(.l2norm(v) - 1) < 1e-4,  abs(.l2norm(w) - 1) < 1e-4, abs(v%*%w) < 1e-4)\n\n  interval_list <- lapply(1:nrow(polyhedra$gamma), function(x){\n    plane <- .plane(polyhedra$gamma[x,], polyhedra$u[x])\n    plane <- .intersect_plane_basis(plane, y, v, w)\n    if(any(is.na(plane))) return(matrix(c(-pi/2, pi/2), ncol = 2))\n    center <- c(-y%*%v, -y%*%w)\n    radius <- sqrt(sum(center^2))\n    circle <- .circle(center, radius)\n    dis <- .distance_point_to_plane(center, plane)\n\n    if(dis >= radius){\n      matrix(c(-pi/2, pi/2), ncol = 2)\n    } else {\n      mat <- .intersect_circle_line(plane, circle)\n      stopifnot(nrow(mat) == 2)\n      vec <- apply(mat, 2, .euclidean_to_radian, circle = circle)\n      init_theta <- .initial_theta(y, v, w)\n      .interval(vec, init_theta)\n    }\n  })\n\n  interval <- .intersect_intervals(interval_list)\n  stopifnot(all(interval[,1] < interval[,2]))\n\n  interval\n}\n\n#' Radius function\n#'\n#' @param theta radians\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#'\n#' @return numeric\n.radius <- function(theta, y, v, w){\n  -2*as.numeric(t(y)%*%(v*sin(theta)+w*cos(theta)))\n}\n\n#' Compute the arctan to find the initial theta\n#'\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#'\n#' @return radians between -pi/2 and pi/2.\n.initial_theta <- function(y, v, w){\n  stopifnot(as.numeric(t(y)%*%v) != 0)\n  atan(-as.numeric(t(y)%*%w)/as.numeric(t(y)%*%v))\n}\n\n#' Convert radians into a sample\n#'\n#' @param theta radians\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#'\n#' @return vector with length of \\code{length(y)}\n.radians_to_data <- function(theta, y, v, w){\n  y + .radius(theta, y, v, w)*(sin(theta)*v + cos(theta)*w)\n}\n\n#' Determine if each y is in polyhedra\n#'\n#' @param y_mat matrix where each column represents a different sample, or\n#' a vector\n#' @param polyhedra \\code{polyhedra} object\n#'\n#' @return vector of booleans, one for each column of \\code{y_mat} (or just one)\n.try_polyhedra <- function(y_mat, polyhedra){\n  if(is.matrix(y_mat)){\n    stopifnot(ncol(polyhedra$gamma) == nrow(y_mat))\n  } else {\n    stopifnot(ncol(polyhedra$gamma) == length(y_mat))\n  }\n\n  res <- polyhedra$gamma %*% y_mat\n\n  if(is.matrix(y_mat)){\n    sapply(1:ncol(res), function(x){all(res[,x] >= polyhedra$u)})\n  } else {\n    all(res >= polyhedra$u)\n  }\n}\n\n#' Construct the interval of radians\n#'\n#' Output is always a vector of length four. We are representing the\n#' interval as two distinct intervals. The first four numbers represent\n#' the interval as a subset of \\code{c(-pi/2,0)}. The last four numbers\n#' represent the interval as a subset of \\code{c(0, pi/2)}.\n#'\n#' Each of the four numbers are two pairs, and all four numbers are\n#' in increasing order. For example, if the interval \\code{c(-pi/2, -pi/3)}\n#' and \\code{c(-pi/4, 0)} were to be expressed, the four numbers would be\n#' \\code{c(-pi/2, -pi/3, -pi/4, 0)}. If the interval \\code{c(-pi/2, -pi/3)}\n#' were to be expressed, the four numbers would be \\code{c(-pi/2, -pi/3, NA, NA)}.\n#' If the interval \\code{c(-pi/2, 0)} were to be expressed, the interval would be\n#' \\code{c(-pi/2, -pi/4, -pi/4, 0)} by default.\n#'\n#' In short, for every four numbers, the first is always -pi/2, 0, or \\code{NA},\n#' while the last is always 0, pi/2, or \\code{NA}.\n#'\n#' If an interval does not intersect with (say)  \\code{c(-pi/2,0)}, four \\code{NA}s\n#' are placed there instead.\n#'\n#' \\code{theta} is a radian that is guaranteed to be \"in\" the interval.\n#'\n#' @param endpoints vector of length 2\n#' @param theta numeric\n#'\n#' @return vector of length 8\n.interval <- function(endpoints, theta){\n  stopifnot(all(c(endpoints, theta) <= pi/2), all(c(endpoints, theta) >= -pi/2))\n\n  interval <- .basic_interval(endpoints, theta)\n  .partition_interval(interval)\n}\n\n#' Convert endpoints into an interval\n#'\n#' Interval is of length 2. \\code{theta} dictates which side of the interval\n#' is included.\n#'\n#' @param endpoints vector of length 2\n#' @param theta initial theta\n#'\n#' @return vector of length 2\n.basic_interval <- function(endpoints, theta){\n  stopifnot(length(endpoints) == 2)\n  stopifnot(all(abs(endpoints) <= pi/2))\n\n  endpoints <- sort(endpoints)\n  if(endpoints[1] <= theta & theta <= endpoints[2]){\n    endpoints\n  } else {\n    c(endpoints[2], endpoints[1]+pi)\n  }\n}\n\n#' Partition an interval of radians\n#'\n#' This function depends heavily on the representation used in\n#' \\code{.basic_interval}. Given an interval, this outputs all the\n#' segments that are equivalent partitioned between -pi/2, 0, and pi/2.\n#'\n#' @param interval vector of length 2\n#' @param tol small positive number\n#'\n#' @return 2-column matrix\n.partition_interval <- function(interval, tol = 1e-6){\n  stopifnot(interval[1] < interval[2])\n  a <- interval[1]; b <- interval[2]\n\n  vec <- seq(-2*pi, 2*pi, by = pi/2)\n  vec <- c(a, vec[intersect(which(vec >= a), which(vec <= b))], b)\n  lis <- lapply(1:(length(vec)-1), function(x){c(vec[c(x,x+1)])})\n\n  idx <- sapply(lis, function(x){mid <- mean(x); sign(mid)*ceiling(abs(mid)/(pi/2))})\n\n  lis <- lapply(1:length(lis), function(x){\n    if(abs(idx[x]) <= 1) return(lis[[x]])\n    lis[[x]] - sign(idx[x])*pi\n  })\n\n  if(length(lis) == 1){\n    mat <- matrix(lis[[1]], ncol = 2)\n  } else {\n    mat <- do.call(rbind, lis)\n    mat <- mat[order(mat[,1]),]\n  }\n\n  idx <- which(mat[,2]-mat[,1] > tol)\n  mat <- mat[idx,,drop = F]\n\n  stopifnot(all(as.numeric(t(mat)) == sort(as.numeric(t(mat)))))\n  stopifnot(all(abs(mat) <= pi/2))\n  mat\n}\n\n#' Intersect intervals\n#'\n#' \\code{lis} is a list of matrices created by \\code{.interval}.\n#'\n#' Returns a matrix with 2 columns, where each row represents a\n#' closed, connected interval of radians. The union of the rows represents\n#' the intersection of all the intervals.\n#'\n#' This function errors if there is no intersection.\n#'\n#' @param lis list of matrices\n#'\n#' @return matrix\n.intersect_intervals <- function(lis){\n  Reduce(.intersect_two_intervals, lis)\n}\n\n#' Intersect two intervals\n#'\n#' Both \\code{mat1} and \\code{mat2} are outputs of \\code{.interval}. This\n#' finds all the radian intervals that lie in their intersection, and returns\n#' it as another matrix that is similar in layout to those outputted by\n#' \\code{.interval}.\n#'\n#' This function errors if there is no intersection.\n#'\n#' @param mat1 matrix\n#' @param mat2 matrix\n#'\n#' @return matrix\n.intersect_two_intervals <- function(mat1, mat2){\n  vec <- sort(unique(c(as.numeric(mat1), as.numeric(mat2))))\n  vec <- sort(c(vec, .interpolate(vec)))\n\n  bool_vec <- sapply(vec, function(x){\n    all(.theta_in_interval(x, mat1), .theta_in_interval(x, mat2))\n  })\n\n  idx_mat <- .consecutive_true(bool_vec)\n\n  mat <- matrix(vec[idx_mat], ncol = 2)\n  mat <- mat[order(mat[,1]),,drop = F]\n\n  stopifnot(all(as.numeric(t(mat)) == sort(as.numeric(t(mat)))))\n  mat\n}\n\n#' Produce a vector with midpoints\n#'\n#' @param vec vector\n#'\n#' @return vector\n.interpolate <- function(vec){\n  n <- length(vec)\n  sapply(2:n, function(x){\n    mean(vec[(x-1):x])\n  })\n}\n\n#' Is theta in an interval\n#'\n#' The \\code{mat} is an output of \\code{.interval}.\n#'\n#' @param theta radian\n#' @param mat matrix\n#'\n#' @return boolean\n.theta_in_interval <- function(theta, mat){\n  stopifnot(abs(theta) <= pi/2)\n\n  vec <- any(apply(mat, 1, function(x){\n    x[1] <= theta & theta <= x[2]\n  }))\n}\n\n#' Finding consecutive sets of TRUE's in a vector\n#'\n#' Returns a 2-column matrix where each row represents a separate pair (start\n#' and end index) of consecutive TRUE's. This function ignores indices\n#' for TRUE that are singleton.\n#'\n#' @param vec vector\n#'\n#' @return 2-column matrix\n.consecutive_true <- function(vec){\n  idx <- which(vec)\n  if(length(idx) == 0) stop(\"No intersection\")\n  breakpoint <- which(sapply(2:length(idx), function(x){idx[x]-idx[x-1] != 1}))\n\n  breakpoint <- c(0, breakpoint, length(idx))\n  mat <- t(sapply(2:length(breakpoint), function(x){\n    c(idx[breakpoint[x-1]+1], idx[breakpoint[x]])\n  }))\n\n  #remove singletons\n  idx <- which(mat[,1] != mat[,2])\n  if(length(idx) == 0) stop(\"No intersection\")\n  mat[idx,]\n}\n\n#' Convert euclidean points on circle into radians\n#'\n#' Only works if the circle is of the form: (x-a)^2 + (y-b)^2 = a^2+b^2.\n#'\n#' @param circle \\code{circle} object\n#' @param point point on circle, as a vector of length 2\n#'\n#' @return radian\n.euclidean_to_radian <- function(circle, point, tol = 1e-3){\n  stopifnot(length(point) == 2, length(circle$center) == 2)\n  stopifnot(abs(circle$radius^2 - sum(circle$center^2)) < tol)\n  stopifnot(abs(sum((point-circle$center)^2) - circle$radius^2) < tol)\n\n  if(point[2] != 0){\n    atan(point[1]/point[2])\n  } else {\n    atan(-circle$center[2]/circle$center[1])\n  }\n}","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/radians.R"},{"filename":"/R/linalg.R","content":"#' Projection of vector onto another vector\n#'\n#' Returns the component of \\code{vec1} that is orthogonal to \\code{vec2}\n#'\n#' @param vec1 vector\n#' @param vec2 vector\n#' @param tol small positive number\n#'\n#' @return vector\n.projection <- function(vec1, vec2, tol = 1e-6){\n  stopifnot(length(vec1) == length(vec2))\n\n  d <- length(vec1)\n  vec2 <- vec2/.l2norm(vec2)\n  as.numeric((diag(d) - vec2%*%t(vec2))%*%vec1)\n}\n\n#' Projection of vector onto rows of a matrix\n#'\n#' Returns the component of \\code{vec} that is orthogonal to all the rows\n#' of \\code{mat}\n#'\n#' @param vec vector\n#' @param mat matrix\n#'\n#' @return vector\n.projection_matrix <- function(vec, mat){\n  stopifnot(length(vec) == ncol(mat), ncol(mat) >= nrow(mat))\n  n <- length(vec)\n  proj_mat <- diag(n) - t(mat) %*% solve(mat %*% t(mat)) %*% mat\n\n  as.numeric(proj_mat %*% vec)\n}\n\n#' Sample unit vectors from the null space of a matrix\n#'\n#' This function assumes the row space of \\code{mat} is the number of\n#' rows in \\code{mat}. If \\code{num_vec} is \\code{NA}, then the function\n#' construct a basis for the entire null space of \\code{mat}, which is\n#' assumed to have dimension equal to the rank of \\code{mat}.\n#'\n#' If \\code{null} is \\code{TRUE}, then this function samples from the nullspace.\n#' Otherwise, sample from the rowspace.\n#'\n#' @param mat matrix\n#' @param num_vec positive integer or \\code{NA}\n#' @param null boolean\n#'\n#' @return a matrix of vectors, with number of rows equal to \\code{ncol(mat)}\n#' and number of columns equal to \\code{num_vec}\n.sample_matrix_space <- function(mat, num_vec = NA, null = T){\n  k <- Matrix::rankMatrix(mat)\n  n <- ncol(mat)\n\n  # form basis of either rowspace or nullspace\n  if(null){\n    res <- matrix(stats::rnorm(n*(n-k)), ncol = n-k)\n    res <- apply(res, 2, .projection_matrix, mat = mat)\n    res <- svd(t(res))$v\n  } else {\n    res <- svd(mat)$v\n  }\n\n  if(is.na(num_vec)) return(res)\n\n  weights <- matrix(stats::rnorm(num_vec*ncol(res)), nrow = ncol(res))\n  vec_mat <- res %*% weights\n\n  #make the vectors orthogonal\n  if(num_vec > 1){\n    for(i in 2:num_vec){\n      vec_mat[,i] <- .projection_matrix(vec_mat[,i], mat = t(vec_mat[,1:(i-1), drop = F]))\n    }\n  }\n\n  sapply(1:ncol(vec_mat), function(x){vec_mat[,x]/.l2norm(vec_mat[,x])})\n}\n\n#' Change basis from lower dimension to higher dimension\n#'\n#' This function assumes \\code{point} is in the coordinate basis in a lower\n#' dimensional space, and translates \\code{point} into a higher-dimensional\n#' space parameterized by the basis matrix \\code{basis_mat}, where each\n#' column represents a different basis vector. Each basis vector must have\n#' l2 norm of 1 and be orthogonal to one another. Additionally, we can shift this\n#' higher dimensional basis by \\code{center}.\n#'\n#' @param point vector of length k\n#' @param center vector of length n\n#' @param basis_mat matrix of size nxk\n#'\n#' @return vector of length n\n.change_basis <- function(point, center, basis_mat, scaling){\n  stopifnot(scaling > 0)\n  stopifnot(sum(abs(t(basis_mat)%*%basis_mat) - diag(ncol(basis_mat))) < 1e-6)\n  stopifnot(length(center) == nrow(basis_mat), ncol(basis_mat) == length(point))\n\n  center + scaling * as.numeric(basis_mat %*% point)\n}\n\n#' Rotation matrix\n#'\n#' Creates a rotation matrix such that when multiplied by a vector, the\n#' component of said vector in the plane spanned by \\code{vec1} and \\code{vec2}\n#' are preserved, and the component in the direction of \\code{vec1} is rotated\n#' towards \\code{vec2}.\n#'\n#' @param vec1 vector\n#' @param vec2 vector\n#'\n#' @return square matrix with number columns and rows equal to the length of \\code{vec1}\n#' @source \\url{https://math.stackexchange.com/questions/598750/finding-the-rotation-matrix-in-n-dimensions}\n.rotation_matrix <- function(vec1, vec2){\n  stopifnot(length(vec1) == length(vec2))\n  d <- length(vec1)\n\n  vec1 <- vec1/.l2norm(vec1)\n  vec2 <- vec2/.l2norm(vec2)\n\n  if(sum(abs(vec1 - vec2)) <= 1e-6) return(diag(d))\n\n  vcomp <- .projection(vec2, vec1)\n  vcomp <- vcomp/.l2norm(vcomp)\n\n  val <- as.numeric(vec1%*%vec2)\n  mat <- matrix(c(val, sqrt(1-val^2), -sqrt(1-val^2), val), ncol = 2)\n  basis <- cbind(vec1, vcomp)\n\n  diag(d) - vec1%*%t(vec1) - vcomp%*%t(vcomp) + basis %*% mat %*% t(basis)\n}\n\n.bijection_matrix <- function(segments){\n\n}","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/linalg.R"},{"filename":"/R/testStatistic.R","content":"#' Compute the next jump for a \\code{bsFs} object\n#'\n#' @param obj \\code{bsFs} object\n#' @param y data\n#' @param ... additional parameters\n#'\n#' @return \\code{bsFs} object with one more jump\n#' @export\nnext_jump.bsFs <- function(obj, y, ...){\n  num_steps <- obj$numSteps\n  binSegInf::binSeg_fixedSteps(y, num_steps+1)\n}\n\n#' Compute distance of next jump\n#'\n#' \\code{jump_vec} is a vector of indices (not necessarily in any particular\n#' order) less than or equal to \\code{n}. A value of \\code{i} in \\code{jump_vec}\n#' denotes that there is jump between index \\code{i} and \\code{i+1}.\n#' \\code{jump_vec} does not need to include \\code{n}.\n#'\n#' @param y data\n#' @param jump_vec_before vector of indices\n#' @param jump_vec_after vector of indices with exactly one additional element\n#' compared to \\code{jump_vec_before}\n#'\n#' @return positive numeric\n.jump_contrast <- function(y, jump_vec_before, jump_vec_after){\n  new_jump <- jump_vec_after[which(!jump_vec_after %in% jump_vec_before)]\n  stopifnot(length(new_jump) == 1)\n\n  n <- length(y)\n  jump_sorted <- c(0, sort(jump_vec_after), n)\n  idx <- which(jump_sorted == new_jump)\n  stopifnot(idx != n)\n  interval_left <- (jump_sorted[idx-1]+1):jump_sorted[idx]\n  interval_right <- (jump_sorted[idx]+1):jump_sorted[idx+1]\n\n  mean(y[interval_right]) - mean(y[interval_left])\n}\n\n#' Test statistic for testing empirical size of next jump\n#'\n#' @param y data\n#' @param fit changepoint fitted model\n#' @param ... nothing\n#'\n#' @return numeric\n#' @export\nnext_jump_statistic <- function(y, fit, ...){\n  next_fit <- next_jump(fit, y)\n  .jump_contrast(y, binSegInf::jumps(fit), binSegInf::jumps(next_fit))\n}\n\n#' Compute the height of a specific jump\n#'\n#' \\code{jump_number} refers to the \\code{jump_number}th jump starting from\n#' the left. This function outputs the difference between the mean of \\code{y}\n#' to the left and to the right of that jump (right minus left)\n#'\n#' @param y data vector\n#' @param fit fitted changepoint object\n#' @param jump positive integer\n#' @param ... not used\n#'\n#' @return numeric\n#' @export\nsegment_difference <- function(y, fit, jump = 1, ...){\n  stopifnot(jump %% 1 == 0, jump > 0)\n\n  jumps <- sort(binSegInf::jumps(fit))\n  stopifnot(jump <= length(jumps))\n  jump_idx <- jumps[jump]\n  stopifnot(jump_idx < length(y))\n\n  jumps <- sort(unique(c(0, jumps, length(y))))\n  idx <- which(jumps == jump_idx)\n  stopifnot(idx != 1)\n\n  mean(y[(jumps[idx]+1):jumps[idx+1]]) -\n    mean(y[(jumps[idx-1]+1):jumps[idx]])\n}","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/testStatistic.R"}],"prof_output":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/.Rproj.user/E62C6A16/profiles-cache/fileb8025bf4ce7d.Rprof","highlight":{"output":["^output\\$"],"gc":["^<GC>$"],"stacktrace":["^\\.\\.stacktraceo(n|ff)\\.\\.$"]},"split":"h"}},"evals":[],"jsHooks":[]}</script>
